struct parameters : public dimensionless_variables
{
    double height{1};
    double radius{1};

    double wall_width{0.01};

    double heater_height{0.1};
    double heater_radius{0.1};

    double heater_power{1};

    struct material
    {
        const double thermal_conductivity;
        const double thermal_capacity;
        
        // lambda evaluates as 1.0 for water;
        const double lambda;

        material(double conductivity,double capacity) : 
        thermal_conductivity(conductivity),
        thermal_capacity(capacity),
        lambda(sqrt((thermal_conductivity * 4200)/(thermal_capacity*0.60))){}
    };
    
    material glass{ 1.15, 840};
    material steel{15.00, 500};
    material water{ 0.60,4200};

    double external_temperature{300};

    double epsilon;

    unsigned x_divisions{512};
    unsigned y_divisions{512};
    double t_step{0.1};

    def_variable(t,t0,1); //???
    def_variable(z,z0,sqrt(glass.thermal_conductivity/glass.thermal_capacity * t0));
    def_variable(T,T0,1); //basically does nothing...
};

typedef boost::numeric::ublas::matrix<double> mat;

struct variables
{
    std::list<mat> temperature_field;

    //std::list<std::vector<std::vector<double>>> temperature_field;
    
    discrete_linspace r,z;
};

class heat_transfer_program : public time_flow_program<parameters,variables>
{
    void init()
    {
        v.r.create_bound_dependent(0,p.radius,p.x_divisions,true);
        v.z.create_bound_dependent(0,p.height,p.y_divisions,true);
        v.temperature_field.clear();

        v.temperature_field.emplace_back(v.r.size(),v.z.size(),p.external_temperature);

        //v.temperature_field.emplace_back(
        //    v.r.size(), std::vector<double>(v.z.size(), p.external_temperature)
        //);
    }

    double heat_power_func(double r, double z)
    {
        if (r < p.heater_radius)
            if ((z > p.height - p.wall_width - p.heater_height) && (z < p.height - p.wall_width)) return p.heater_power * p.t0 / p.glass.thermal_capacity / p.T0;
        return 0.0;
    }

    double lambda2_func(double r, double z)
    {
        if (r > p.radius - p.wall_width) return p.steel.lambda*p.steel.lambda;
        if ((z < p.wall_width) && (z > p.height - p.wall_width)) return p.steel.lambda*p.steel.lambda;
        if ((r < p.heater_radius) && (z > p.height - p.wall_width - p.heater_height) && (z < p.height - p.wall_width)) return p.steel.lambda*p.steel.lambda;
        else return p.water.lambda*p.water.lambda;
    }

    void cycle_function()
    {
        auto& prev_T = *v.temperature_field.rbegin();
        mat T(v.r.size(),v.z.size());

        mat dTdr    (v.r.size(),v.z.size());
        mat dTdz    (v.r.size(),v.z.size());
        mat d2Tdr2  (v.r.size(),v.z.size());
        mat d2Tdz2  (v.r.size(),v.z.size());

        for (size_t i = 0; i < v.z.size(); i++) my_functions::differentiate(v.r.get_step(),(prev_T.begin2()+i).begin(),(prev_T.begin2()+i).end(),dTdr.begin2().begin());
        for (size_t i = 0; i < v.r.size(); i++) my_functions::differentiate(v.z.get_step(),(prev_T.begin1()+i).begin(),(prev_T.begin1()+i).end(),dTdz.begin1().begin());
        for (size_t i = 0; i < v.z.size(); i++) my_functions::differentiate(v.r.get_step(),(dTdr.begin2()+i).begin(),(dTdr.begin2()+i).end(),d2Tdr2.begin2().begin());
        for (size_t i = 0; i < v.r.size(); i++) my_functions::differentiate(v.z.get_step(),(dTdz.begin1()+i).begin(),(dTdz.begin1()+i).end(),d2Tdz2.begin1().begin());


        auto l2 = [&](unsigned i, unsigned j) {return lambda2_func(v.r[i],v.z[j]);};
        double& dt = p.t_step;
        double dr = v.r.get_step();
        double dz = v.z.get_step();

        

        // time step [t_i -> t_i+0.5*dt]
        run_through_method<double> by_r;
        for (size_t j = 0; j < v.z.size(); j++)
        {
            //double Q = heat_power_func(); //Функция мощности тепла
            by_r.A = [&](unsigned i){ return    -l2(i,j) * dt / 4.0 * (1.0 / dr / dr - 0.5 / dr / v.r[i]); };
            by_r.B = [&](unsigned i){ return 1 + l2(i,j) * dt / 2.0 / dr / dr; };
            by_r.C = [&](unsigned i){ return    -l2(i,j) * dt / 4.0 * (1.0 / dr / dr + 0.5 / dr / v.r[i]); };
            by_r.D = [&](unsigned i){ return    prev_T(i, j) + dt / 4.0 * (l2(i,j)*(d2Tdr2(i,j) + dTdr(i,j)/v.r[i] + 2*d2Tdz2(i,j))+ 2*heat_power_func(v.r[i],v.z[j])); };

            unsigned i_last = prev_T.size1()-1;
            by_r.evaluate(v.r.size(),1,0,prev_T(i_last,j));
            std::move(by_r.output.begin(),by_r.output.end(),T.begin1().begin());
        }

        for (size_t i = 0; i < v.z.size(); i++) my_functions::differentiate(v.r.get_step(),(T.begin2()+i).begin(),(T.begin2()+i).end(),dTdr.begin2().begin());
        for (size_t i = 0; i < v.r.size(); i++) my_functions::differentiate(v.z.get_step(),(T.begin1()+i).begin(),(T.begin1()+i).end(),dTdz.begin1().begin());
        for (size_t i = 0; i < v.z.size(); i++) my_functions::differentiate(v.r.get_step(),(dTdr.begin2()+i).begin(),(dTdr.begin2()+i).end(),d2Tdr2.begin2().begin());
        for (size_t i = 0; i < v.r.size(); i++) my_functions::differentiate(v.z.get_step(),(dTdz.begin1()+i).begin(),(dTdz.begin1()+i).end(),d2Tdz2.begin1().begin());



        // time step [t_i+0.5*dt -> t_i+1]
        run_through_method<double> by_z;    
        for (size_t i = 0; i < v.z.size(); i++)
        {
            by_z.A = [&](unsigned j){return    -l2(i,j)*dt/4.0/dz/dz;};
            by_z.B = [&](unsigned j){return 1 + l2(i,j)*dt/2.0/dz/dz;};
            by_z.C = [&](unsigned j){return    -l2(i,j)*dt/4.0/dz/dz;};
            by_z.D = [&](unsigned j){return T(i,j) + dt/2.0 * (l2(i,j)*(d2Tdr2(i,j)+dTdr(i,j) + d2Tdz2(i,j)/2.0)+heat_power_func(v.r[i],v.z[j]));};

            
            unsigned j_last = prev_T.size2()-1;
            by_z.evaluate(v.z.size(),1,0,T(j_last,i));
            std::move(by_z.output.begin(),by_z.output.end(),T.begin2().begin());
        }

        // It is possible that first order boundary conditions already considered on R = 0, Z = 0

        boundary_condition_first_order right_border(
            (1.0-p.epsilon/(2*p.steel.thermal_conductivity))/(1+p.epsilon/(2*p.steel.thermal_conductivity)),
            p.epsilon*p.external_temperature/(1+p.epsilon/(2*p.steel.thermal_conductivity))
        );

        
        boundary_condition_first_order upper_border(
            (1.0-p.epsilon/(2*p.glass.thermal_conductivity))/(1+p.epsilon/(2*p.glass.thermal_conductivity)),
            p.epsilon*p.external_temperature/(1+p.epsilon/(2*p.glass.thermal_conductivity))
        );

        //conditions applying here...
        


        v.temperature_field.emplace_back(std::move(T));
    }
};

